var Level = function(tilesetImage, levelWidth, levelHeight, tileWidth, tileHeight) {
    this.tiles = [];
    this.tilesetImage = tilesetImage;
    this.levelWidth = levelWidth;
    this.levelHeight = levelHeight;
    this.tileWidth = tileWidth;
    this.tileHeight = tileHeight;
    this.x = 0;
    this.y = 0;
    this.tileSpacing = 1;
    this.tilesetTileWidth = Math.floor(628 / (tileWidth + this.tileSpacing));
}

Level.prototype.generateLevel = function() {
    var count = 0;
    for (var r = 0; r < this.levelHeight; r++) {
        this.tiles[r] = [];
        for (var c = 0; c < this.levelWidth; c++) {
            this.tiles[r].push(count++);
            //this.tiles[r].push(0);
        }
    }
}

Level.prototype.loadLevel = function(tiledJSMapName) {
    var layer1Tiles = TileMaps["citymap"]["layers"][0]["data"];
    var layer2Tiles = TileMaps["citymap"]["layers"][1]["data"];

    for (var r = 0; r < this.levelHeight; r++) {
        this.tiles[r] = [];
        for (var c = 0; c < this.levelWidth; c++) {
            this.tiles[r].push(layer1Tiles[(r * 37) + c]);
        }
    }

    // Needs another layer to support this...
    //for (var r = 0; r < this.levelHeight; r++) {
    //    this.tiles[r] = [];
    //    for (var c = 0; c < this.levelWidth; c++) {
    //        this.tiles[r].push(layer2Tiles[(r * 37) + c]);
    //    }
    //}
}

Level.prototype.render = function(context) {
    clearCanvas();

    for (var r = 0; r < this.levelHeight; r++) {
        for (var c = 0; c < this.levelWidth; c++) {
            var tileX = this.x + (c * this.tileWidth);
            var tileY = this.y + (r * this.tileHeight);

            if (tileX < 640 && tileX + this.tileWidth > 0 && tileY < 480 && tileY + this.tileHeight > 0) {
                var clipX = (this.tiles[r][c] % this.tilesetTileWidth) * (this.tileWidth + this.tileSpacing);
                clipX -= Math.floor(this.tiles[r][c] / this.tilesetTileWidth);
                var clipY = Math.floor(this.tiles[r][c] / this.tilesetTileWidth) * (this.tileHeight + this.tileSpacing);

                context.drawImage(this.tilesetImage, clipX, clipY, this.tileWidth, this.tileHeight, tileX, tileY, this.tileWidth, this.tileHeight);
            }
        }
    }
}

var g_sources = {
    tileset: "../../static/images/tileset.png"
};
var g_images = {};

var canvas;
var context;

var level;

window.onload = function() {
    canvas = document.getElementById("game_canvas");
    context = canvas.getContext("2d");

    debugDrawText("Logic error!");

    loadImages(g_sources, function(g_images) {
        level = new Level(g_images.tileset, 64, 64, 16, 16);
        //level.generateLevel();
        level.loadLevel("citymap");
        level.render(context);
    });
}

// =============== CANVAS RELATED FUNCTIONS ===============

function debugDrawText(text) {
    clearCanvas();

    context.font = "30px Arial";
    context.fillText(text, 10, 50);
}

function clearCanvas() {
    context.clearRect(0, 0, canvas.width, canvas.height);
}

function onKeyPressed(charCode) {
    var charCodeStrings = {"119": "up", "97": "left", "115": "down", "100": "right"};

    if (charCode in charCodeStrings) {
        var charString = charCodeStrings[charCode];

        switch (charString) {
            case "up":
                level.y += 5;
                break;
            case "left":
                level.x += 5;
                break;
            case "down":
                level.y -= 5;
                break;
            case "right":
                level.x -= 5;
                break;
        }

        level.render(context);
    }
}

// =============== UTILITY FUNCTIONS ===============

function loadImages(sources, callback) {
    var images = {};
    var loadedImages = 0;
    var numImages = 0;

    // get num of sources
    for(var src in sources) {
        numImages++;
    }

    for(var src in sources) {
        images[src] = new Image();
        images[src].onload = function() {
            if(++loadedImages >= numImages) {
                callback(images);
            }
        };
        images[src].src = sources[src];
    }
}
